input = ""

shortest = nil

("a".."z").each do |to_remove|
  polymer = input.dup
  polymer.gsub!(to_remove, "")
  polymer.gsub!(to_remove.upcase, "")

  pairs = ("a".."z").flat_map do |c|
    [
      "#{c}#{c.upcase}",
      "#{c.upcase}#{c}"
    ]
  end

  reducing = true

  while reducing
    reducing = false

    pairs.each do |pair|
      if i = polymer.index(pair)
        polymer.slice!(i, 2)
        reducing = true
      end
    end
  end

  if shortest.nil? || polymer.length < shortest
    shortest = polymer.length
  end
end

puts shortest
